callback_with_context.context_function_id:
(speed   = ToNumber(self.GetProperty("speed")),
 gravity = ToNumber(self.GetProperty("gravity")),
 pipes   = Component("pipes_container").ChildList) => {
 DoIf(self.ParentContext.GetProperty("game_over") != "1",

  self.SetProperty("speed", speed + gravity);
  self.SetDockOffset(self.RelativePosition.x, MaxNumericValue(self.RelativePosition.y + speed, -self.Dimensions.y+2));
  self.RotateImage(0, speed * 3 + 90);

  pipes.ForEach((c) =>
    DoIf(
      self.Position.x > c.ChildContext("score_box").Position.x && c.ChildContext("score_box").GetProperty("hit") != "1",
      c.ChildContext("score_box").SetProperty("hit", 1); UiMsg("AddScore")
    )
  );

  DoIf(
    self.Position.y + self.Dimensions.y > Component("ground").Position.y,
    self.ParentContext.SetProperty("game_over", 1); self.SetState("squashed"); Component("game_over_state").SetVisible(true));

  DoIf(
    pipes.Any(
      (p, t = p.ChildContext("pipe_top"), b = p.ChildContext("pipe_bottom"), x_ok = (self.Position.x + self.Dimensions.x) > (t.Position.x + 3) && self.Position.x < (t.Position.x + t.Dimensions.x - 3)) => 
      p.IsVisible && x_ok && (self.Position.y < (t.Position.y + t.Dimensions.y - 3) || (self.Position.y + self.Dimensions.y - 3) > b.Position.y)
    ),
    self.ParentContext.SetProperty("game_over", 1); self.SetState("squashed"); Component("game_over_state").SetVisible(true)
  )

)}

Component("F10CAD23-25AE-4C2A-A3D4F1EE423D7594").ChildList.ForEach((c)=>c.SetDockOffset(c.ChildIndex * c.Dimensions.x, c.RelativePosition.y));
Component("bird").SetDockOffset(114, 302);
Component("bird").SetState("default");
Component("bird").SetProperty("speed", 0);
Component("pipes_container").ChildList.ForEach((c)=>
  c.SetDockOffset(325 * c.ChildIndex, 0); c.SetVisible(false); c.ChildContext("score_box").SetProperty("hit", 1)
);
self.ParentContext.ParentContext.SetVisible(false);
Component("board").SetProperty("game_over", 0);
Component("D11A92B1-F40A-4106-8A91F95C7B3C09E0").SetText("0")

DoIf(self.ParentContext.GetProperty("game_over") != "1",

self.ChildList.ForEach((c) =>
  c.SetDockOffset(c.RelativePosition.x - 7, c.RelativePosition.y);
  DoIf(
    c.RelativePosition.x < -c.Dimensions.x,
    c.SetVisible(true);
    c.SetDockOffset(self.Dimensions.x, TrueRandomInRange(-320, 0));
    c.ChildContext("score_box").SetProperty("hit", 0))
)

)
